import { NavLink } from "react-router-dom";
import styled from "styled-components";
import DialogItem from "./DialogItem";

export const DialogsPage = () => {
  return (
    <DialogsPageWrapper>
      <DialogsListWrapper>
        <DialogsList>
            <DialogItem id={"1"} userName={"Danila"}/>
            <DialogItem id={"2"} userName={"Vasya"}/>
            <DialogItem id={"3"} userName={"Ivan"}/>
            <DialogItem id={"4"} userName={"Petya"}/>
        </DialogsList>
      </DialogsListWrapper>
      <MessengerWrapper>
        <Message>Hi</Message>
        <Message>How are you</Message>
        <Message>Good</Message>
      </MessengerWrapper>
    </DialogsPageWrapper>
  );
};

const DialogsPageWrapper = styled.div`
  width: 100%;
  display: flex;
  flex-direction: row;
  justify-content: start;
  gap: 5rem;
`;

//styling the dialogs(users)
const DialogsListWrapper = styled.div``;
